pragma solidity >=0.4.21 <0.7.0;

import "./Ownable.sol";

contract FakeTrader is Ownable {
    mapping (address => mapping (string => uint)) traderToCurrencyToBalance;
    mapping (address => uint[]) traderToCompetitions;

    uint currentCompetition = 1;
    uint startTimestamp = now;
    uint competitionDuration = 7 days;

    modifier isOpen(uint _competitionId) {
        require(now < startTimestamp + competitionDuration, "Competition is closed");
        require(_competitionId == currentCompetition, "Not the current competition");
        _;
    }

    modifier isNotStarted(uint _competitionId) {
        require(_competitionId > currentCompetition, "It is not a future competition");
        _;
    }

    modifier isParticipant(address _trader, uint _competitionId) {
        if (_participate(_trader, _competitionId)) _;
    }

    modifier isNotParticipant(address _trader, uint _competitionId) {
        if (!_participate(_trader, _competitionId)) _;
    }

    function _participate(address _trader, uint _competitionId) private view returns (bool) {
        uint[] memory competitions = traderToCompetitions[_trader];
        bool participant = false;

        for (uint i = 0; i < competitions.length; i++) {
            if (competitions[i] == _competitionId) {
                participant = true;
                break;
            }
        }

        return participant;
    }

    // TODO: (later) add participation fee
    function joinCompetition(uint _competitionId) public isNotStarted(_competitionId) isNotParticipant(msg.sender, _competitionId) {
        traderToCompetitions[msg.sender].push(_competitionId);
    }

    // TODO: (later) refund participation fee
    function leaveCompetition(uint _competitionId) public isNotStarted(_competitionId) isParticipant(msg.sender, _competitionId) {
        uint[] storage competitions = traderToCompetitions[msg.sender];
        delete competitions[_competitionId];
    }

    function buy(uint _currencyAmount, string memory _currency) public {
        uint currencyPrice = getPrice(_currency);
        uint tradePrice = _currencyAmount * currencyPrice;
        traderToCurrencyToBalance[msg.sender]["tradercoin"] -= tradePrice;
        traderToCurrencyToBalance[msg.sender][_currency] += _currencyAmount;
    }

    function sell(uint _currencyAmount, string memory _currency) public {
        uint currencyPrice = getPrice(_currency);
        uint tradePrice = _currencyAmount * currencyPrice;
        traderToCurrencyToBalance[msg.sender]["tradercoin"] += tradePrice;
        traderToCurrencyToBalance[msg.sender][_currency] -= _currencyAmount;
    }

    function getPrice(string memory _currency) public view returns (uint) {
        // Implement price feeder method
    }

    function setCompetitionDuration(uint _competitionDuration) external onlyOwner {
        competitionDuration = _competitionDuration;
    }
}
